import React from "react";
import { Box } from "@mui/material";

const FlightLogs = () => {
  return (
    <>
      <Box
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "flex-start", // Align items to the top
          height: "100px",
          marginBottom: "15px",
          position: "relative", // Necessary for the absolute positioning of inner Box
        }}
      >
        <Box
          style={{
            borderTop: "1px solid #f59331",
            width: "80%",
            position: "absolute", // This will position the box at the top
            top: "0",
            left: "50%",
            transform: "translateX(-50%)", // Center the box horizontally
          }}
        >
          <Box
            style={{
              position: "absolute",
              top: "-25px", // Adjust as needed to position the Logs label
              left: "50%",
              transform: "translateX(-50%)",
              backgroundColor: "#181818",
              padding: "0 7px",
              zIndex: 1,
              fontSize: "25px",
            }}
          >
            Logs
          </Box>
        </Box>
      </Box>
    </>
  );
};

export default FlightLogs;
